import {GreetingText} from './GreetingText'

export const Home = () => {  
    return (
    <div id="Home" className = "home">
        <GreetingText/>

        <image 
            className="personal-image"
            style={{width: 200, height: 200, borderRadius: 400/ 2}} 
            source={"/src/assets/slay_racoon.webp"}
        />
    </div>
    )
  }

  export default Home
